import React, { useEffect } from 'react'
import AOS from 'aos'
import "aos/dist/aos.css";

export const AboutMe = () => {
    useEffect(() => {
        AOS.init({ duration: 2000 })
    }, [])

    return (
        <section 
            data-aos="fade-down-left"
            className="about-me"
        >
            <h2 className="about-me__tittle">Мое обучение</h2>
            <p className="about-me__tittle"></p>
        </section>
    )
}
